    font-size:  1.5vw;
    font-style: normal;
    font-weight: 600;

    line-height: 2.5vw;
    letter-spacing: 0em;

    text-align: center;
    text-decoration : none;

    padding :  5% 2% 5% 2%;

    margin-top : 3%;
    margin-left : 5%;
